package com.ezen.koh10.score0319;

public class InsaDTO {
	int id;
	String position;
	int family;
	int nomal;
	public InsaDTO() {
		super();
		// TODO Auto-generated constructor stub
	}
	public int getId() {
		return id;
	}
	public void setId(int id) {
		this.id = id;
	}
	public String getPosition() {
		return position;
	}
	public void setPosition(String position) {
		this.position = position;
	}
	public int getFamily() {
		return family;
	}
	public void setFamily(int family) {
		this.family = family;
	}
	public int getNomal() {
		return nomal;
	}
	public void setNomal(int nomal) {
		this.nomal = nomal;
	}
	
}
